import React from 'react'

import Sectors from 'C:/MY_PROJECT/final/src/rawData/sectorNames.json'

const UserPage = () => {

  var sectorName =Sectors

  function check(){
    alert(document.getElementById("sector").innerHtml)
  }

  const myStyle={
    backgroundImage:'url(item.sector)',
    color:"red",
    // backgroundColor:"white"
  }

  return (
    <div className="userPage">
        This is user Page
        <div className='userPageCards m-3'>
            {sectorName.map(item => <li key={item.sector_name} className='sector' style={myStyle}>{item.sector_name}</li>)}
        </div>
    </div>
  )
}

export default UserPage
